import './App.scss';
import {Route, BrowserRouter as Router} from 'react-router-dom';
import {Home} from './pages/home';
import {Login} from './pages/login';

function App() {
  return (

    <Router>
      <h1>Aonflow</h1>
      <Route path="/" exact component={Login} />
      <Route path="/home" component={Home} />
    </Router>
  );
}

export default App;
